"use strict";const deleteUser=()=>{const e=document.querySelector(".client-requests");e&&e.addEventListener("click",e=>{if(e.target.matches('button[data-btn="delete"]')){const t=e.target.parentNode.parentNode,r=e.target.dataset.id;fetch("/user/"+r,{method:"DELETE"}).then(e=>{t.remove()}).catch(e=>{throw e})}})};deleteUser();